import * as React from 'react';
import { AppBar, Toolbar, Drawer, Box, List, ListItem, ListItemText, Button } from '@mui/material';
import logo from './logo.png';  // Ensure this path is correct

const Navbar = () => {
  const [drawerOpen, setDrawerOpen] = React.useState(false);

  const handleDrawerToggle = () => {
    setDrawerOpen(!drawerOpen);
  };

  const drawer = (
    <Box onClick={handleDrawerToggle} sx={{ textAlign: 'center', width: 250 }}>
      <List>
        <ListItem button>
          <ListItemText primary="Home" sx={{ textAlign: 'center' }} />
        </ListItem>
        <ListItem button>
          <ListItemText primary="About" sx={{ textAlign: 'center' }} />
        </ListItem>
        <ListItem button>
          <ListItemText primary="Services" sx={{ textAlign: 'center' }} />
        </ListItem>
        <ListItem button>
          <ListItemText primary="Contact" sx={{ textAlign: 'center' }} />
        </ListItem>
      </List>
    </Box>
  );

  return (
    <AppBar position="static" sx={{ background: 'transparent', boxShadow: 'none' }}>
      <Toolbar sx={{ justifyContent: 'center', padding: '20px 0', flexDirection: 'column' }}>
        {/* Logo directly above the menu items */}
        <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginBottom: 2 }}>
          <img src={logo} alt="Logo" style={{ height: '50px', marginBottom: '20px' }} />
          <Box sx={{ display: 'flex', justifyContent: 'center' }}>
            <Button sx={{ mx: 2, color: 'text.primary' }}>Home</Button>
            <Button sx={{ mx: 2, color: 'text.primary' }}>About</Button>
            <Button sx={{ mx: 2, color: 'text.primary' }}>Services</Button>
            <Button sx={{ mx: 2, color: 'text.primary' }}>Contact</Button>
          </Box>
        </Box>
      </Toolbar>
      <Drawer
        anchor="left"
        open={drawerOpen}
        onClose={handleDrawerToggle}
      >
        {drawer}
      </Drawer>
    </AppBar>
  );
};

export default Navbar;
